import React from "react";

const redirections = ["Matrix Gifs", "Rick amd Morty gifs", "Platzi Gifs"];


const MoreUsed = () =>{
    return(
        <div className="MoreUsed mb-4">
            <h3>More Used</h3>
            <div className="row">
                {redirections.map(redirection => <a className="col-4" >{redirection}</a>)}
            </div>
        </div>
    )
}


export default MoreUsed;
